import React from 'react';
import Marquee from 'react-fast-marquee';
import { Link } from 'react-router-dom';
const Marque = () => {
    return (
        <div>
            <div className='flex pt-7 text-center'>
                
                <Marquee className='space-x-16 paus gap-4'>
                    <Link to='/news'>
                    <img className='w-40' src="data:image/png;base64," alt="" />
                     </Link>
                     <Link to='/news'>
                     <img className='w-40' src="data:image/png;base64," alt="" />
                    </Link>

                    <Link to='/news'>
                    <img className='w-40 gap-4' src="data:image/jpeg;base64," alt="" />
                    </Link>
                    <Link to='/news'>
                     <img className='w-40 gap-4' src="data:image/png;base64," alt="" />
                    </Link> 
                    <Link to='/news'>
                     <img className='w-40' src="data:image/png;base64," alt="" />
                    </Link> 
                    <Link to='/news'>
                     <img className='w-40' src="data:image/png;base64," alt="" />
                    </Link>



                </Marquee>
            </div>
        </div>
    );
};

export default Marque;